import React from "react";
import Header from "../layout/Header";
import Contents from "../layout/Contents";
import Footer from "../layout/Footer";

function Reference() {
  return (
    <>
      <Header />
      <Contents>
        <Title />
        <ReferCont />
        <Contact />
      </Contents>
      <Footer />
    </>
  );
}

export default Reference;
